	('user1401', 422, 'taxi', '원주이나 횡성에서 전주가시는 분 모십니다.\n오늘저녁에 출발 예정이고 요금은 10000원정도 생각하고 있습니다. 고향가는 길인데 비도오고 버스타고 가기 불편하실텐데 즐겁게 내려가요~요즘 전주 놀러가시는 분 많던데ㅎㅎ', NULL, '37.4353371', '127.9730774', '강원도 원주시 소초면', '35.807847706109825', '127.10141513496639', '전라북도 전주시 효자동2가', NULL, '상관없음', '상관없음', '오늘', '18:00', '2015-11-13 18:00:00', '종료됨', 'Y', '29', '카풀', '나눠서 분담', 'N', '2015-11-13 11:57:33', NULL, NULL);
